import React from "react";
import PropTypes from "prop-types";

const CustomInputFeild = ({type,placeholder,value,onChange,disabled,showError}) => {
  return (
    <div>
      <input
        type={type}
        placeholder={placeholder}
        value={value}
        onChange={onChange}
        className={`w-full px-3  py-4 rounded-lg mx-5 border ${showError ? 'border-red-600 ': 'border-gray-200'}   focus:outline-indigo`}
        disabled={disabled || false}
      />
    </div>
  );
};

CustomInputFeild.propTypes = {
    type: PropTypes.string,
    placeholder: PropTypes.string,
    value: PropTypes.string,
    onChange: PropTypes.func.isRequired,
    disabled: PropTypes.bool,
    showError: PropTypes.bool,
};

export default CustomInputFeild;
